import { Component,OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { BackendserviceService } from '../backendservice.service';

@Component({
  selector: 'app-admin',
  templateUrl: './admin.component.html',
  styleUrls: ['./admin.component.css']
})
export class AdminComponent implements OnInit {
  constructor(private api:BackendserviceService,private router:Router){}
  employees: any[] = [];
  ngOnInit(){
    this.api.fetchData().subscribe((res:any)=>{
      this.employees = res.data
      //console.log(this.employees);
    })
  }
  editForm(id:any){
    //console.log(id)
    this.router.navigate(["/edit/"+id]);
  }
  deleteForm(id:any){
      this.api.delete(id).subscribe((res:any)=>{console.log('Success')})
      this.api.fetchData().subscribe((res:any)=>{
      this.employees = res.data
    })

}
}
<app-header></app-header>
<div class="container mt-4">
  <div class="row">
    <div class="col-6">
      <h1 class="fw-bold mb-3">Employee List</h1>
    </div>
    <div class="col-6 d-flex justify-content-end">
      <button routerLink="/employeeform" class="btn btn-primary">
        <i class="bi bi-plus-square"></i> Add Employee
      </button>
    </div>
  </div>

  <div class="table-responsive">
    <table class="table custom-table">
      <thead>
        <tr>
          <th>Name</th>
          <th>Designation</th>
          <th>Location</th>
          <th>Salary</th>
          <th>Actions</th>
        </tr>
      </thead>
      <tbody>
        <tr *ngFor="let person of employees">
          <td>{{ person.name }}</td>
          <td>{{ person.designation }}</td>
          <td>{{ person.location }}</td>
          <td>{{ person.salary }}</td>
          <td>
            <button class="btn btn-warning me-2" (click)="editForm(person._id)">
              <i class="bi bi-pencil-square"></i> Edit
            </button>
            <button class="btn btn-danger" (click)="deleteForm(person._id)">
              <i class="bi bi-trash3"></i> Delete
            </button>
          </td>
        </tr>
      </tbody>
    </table>
  </div>
</div>
